    function addTable() {
      //create table
      var table = $("<table>").addClass("table table-bordered");

      var headrow = $("<tr>");

      //add headers
      for (k = 0; k <= 17; k++) {
        var header = $("<th>").prop("scope","col");
        if (k === 0) {
          header.text("Derechos").addClass("derechosHeader").css({"width":"15vw","height":"5vw","padding":"2%"});
        } else {
          header.css({"background-image":ods[k-1],"background-size": "contain","background-position": "center","width":"5vw"});
        }
        headrow.append(header);
      }
      table.append($("<thead>").addClass("sticky").css("background-color","white").append(headrow));

      var body=$("<tbody>");

      //add rows
      for (i = 0; i < derechos.length; i++) {
        var row = $("<tr>")
          .addClass("tabRow")
          .attr("id", "row" + i);

        //cel with text
        var cell = $("<td>").addClass("textDerechos").text(derechos[i]);
        row.append(cell);
        
        //empty cells to color
        for (j = 0; j < 17; j++) {
          let color = colors[j];
          var cell = $("<td>")
            .addClass("emptyCell")
            .css("text-align","center")
            .attr("id", i + "-" + j)
            .attr("data-click-state", 0)
            .attr("data-hover-state", 0)
            .click(function () {
              if ($(this).attr("data-click-state") == 1) {
                //remove color
                $(this).attr("data-click-state", 0);
                $(this).css("background-color", "transparent");
                const index = answers.indexOf($(this).attr("id"));
                if (index > -1) {
                  answers.splice(index, 1);
                }
              } else {
                //color
                $(this).attr("data-click-state", 1);
                $(this).css("background-color", color);
                $(this).css("border-radius", "0%");
                answers.push($(this).attr("id"));
              }
              $("#ammount").html(answers.length);
              $("#possible").html(correct.length);
            })
            .hover(function () {
              if ($(this).attr("data-click-state") == 0) {
                //remove colored circle
                if ($(this).attr("data-hover-state") == 1) {
                  $(this).attr("data-hover-state", 0);
                  $(this).css("background-color", "transparent");
                } else {
                  //add color circle
                  $(this).attr("data-hover-state", 1);
                  $(this).css("background-color", color);
                  $(this).css("border-radius", "100%");
                }
              }
            });
          row.append(cell);
        }
        body.append(row);
      }
      
      $("#here_table").append(table.append(body)).css("padding","2%");
    }

    function hoverFunc(cell) {}

    function checkAnswers() {
      $(".emptyCell").html("&nbsp;");

      //answered correctly
      rightAnswered = answers.map((answer) => {
        if (correct.includes(answer)) {
          return answer;
        }
      });
      rightAnswered = rightAnswered.filter((x) => x !== undefined);

      //answered wrong
      wrongAnswered = answers.map((answer) => {
        if (!correct.includes(answer)) {
          return answer;
        }
      });
      wrongAnswered = wrongAnswered.filter((x) => x !== undefined);

      //missing to answer
      missingAnswers = correct.map((answer) => {
        if (!answers.includes(answer)) {
          return answer;
        }
      });
      missingAnswers = missingAnswers.filter((x) => x !== undefined);

      console.log(correct);
      console.log(answers);
      console.log(rightAnswered);
      console.log(wrongAnswered);
      console.log(missingAnswers);

      // Returns a Promise that resolves after "ms" Milliseconds
      const timer = (ms) => new Promise((res) => setTimeout(res, ms));

      rightAnswered.map((cell) => {
        $("#" + cell).text("✔️");
      });
      wrongAnswered.map((cell) => {
        $("#" + cell).text("❌");
      });
      /*missingAnswers.map((cell) => {
        $("#" + cell).text("⚠️");
      });*/
    }

  </script>
